Vue.component("workflow-list", {
  data() {
    return {
      items: [],
      newWorkflow: {
        title: '',
        description: ''
      },
      workflowType: 'standard',
      isTitleValid: true,
      titleError: 'Name is required',
      selectedWorkflow: {
        id: '',
        title: ''
      }
    };
  },
  methods: {
    load() {
      fetch(piranha.baseUrl + 'manager/api/workflow/list').then(response => response.json()).then(result => {
        this.items = result;
      }).catch(error => console.log("error:", error));
    },
    addWorkflow() {
      this.newWorkflow = {
        title: '',
        description: ''
      };
      this.isTitleValid = true;
      this.titleError = '';
      this.workflowType = 'standard';
      $('#workflowModal').modal('show');
    },
    validateTitle() {
      if (!this.newWorkflow.title) {
        this.isTitleValid = false;
        this.titleError = 'Name is required';
        return;
      }
      fetch(piranha.baseUrl + 'manager/api/workflow/title-unique?title=' + encodeURIComponent(this.newWorkflow.title)).then(response => response.json()).then(result => {
        this.isTitleValid = result;
        if (!result) {
          this.titleError = 'Name already in use';
        }
      }).catch(error => console.log("error:", error));
    },
    createWorkflow() {
      if (!this.newWorkflow.title) {
        this.isTitleValid = false;
        this.titleError = 'Name is required';
        return;
      }
      if (!this.isTitleValid) {
        return;
      }
      if (this.workflowType === 'standard') {
        fetch(piranha.baseUrl + 'manager/api/workflow/create-standard', {
          method: 'POST',
          headers: piranha.utils.antiForgeryHeaders(),
          body: JSON.stringify(this.newWorkflow)
        }).then(response => {
          if (!response.ok) {
            return response.json().then(error => {
              throw error;
            });
          }
          return response.json();
        }).then(result => {
          this.load();
          $('#workflowModal').modal('hide');

          // Show notification
          piranha.notifications.push({
            body: 'The workflow was created successfully',
            type: 'success'
          });
        }).catch(error => {
          console.log("error:", error);
          piranha.notifications.push({
            body: error.body || 'An error occurred while creating the workflow',
            type: 'danger'
          });
        });
      } else {
        fetch(piranha.baseUrl + 'manager/api/workflow/save', {
          method: 'POST',
          headers: piranha.utils.antiForgeryHeaders(),
          body: JSON.stringify({
            id: '',
            title: this.newWorkflow.title,
            description: this.newWorkflow.description,
            isDefault: false,
            stages: []
          })
        }).then(response => {
          if (!response.ok) {
            return response.json().then(error => {
              throw error;
            });
          }
          return response.json();
        }).then(result => {
          this.load();
          $('#workflowModal').modal('hide');

          // Show notification
          piranha.notifications.push({
            body: 'The workflow was created successfully',
            type: 'success'
          });
        }).catch(error => {
          console.log("error:", error);
          piranha.notifications.push({
            body: error.body || 'An error occurred while creating the workflow',
            type: 'danger'
          });
        });
      }
    },
    editWorkflow(workflow) {
      window.location.href = piranha.baseUrl + 'manager/workflow/edit/' + workflow.id;
    },
    removeWorkflow(workflow) {
      this.selectedWorkflow = workflow;
      $('#workflowDeleteModal').modal('show');
    },
    confirmDeleteWorkflow() {
      fetch(piranha.baseUrl + 'manager/api/workflow/' + this.selectedWorkflow.id, {
        method: 'DELETE',
        headers: piranha.utils.antiForgeryHeaders()
      }).then(response => {
        $('#workflowDeleteModal').modal('hide');

        // Remove from list
        this.items = this.items.filter(w => w.id !== this.selectedWorkflow.id);

        // Show notification
        piranha.notifications.push({
          body: 'The workflow was deleted successfully',
          type: 'success'
        });
      }).catch(error => {
        console.log("error:", error);
        piranha.notifications.push({
          body: 'An error occurred while deleting the workflow',
          type: 'danger'
        });
      });
    },
    formatDate(date) {
      return new Date(date).toLocaleDateString();
    }
  },
  created() {
    this.load();
  },
  template: "\n<div class=\"card\">\n  <div class=\"card-header\">\n    <span class=\"title\">Workflows</span>\n    <div class=\"btn-group float-right\">\n      <button v-on:click=\"addWorkflow\" class=\"btn btn-primary btn-labeled\">\n        <i class=\"fas fa-plus\"></i>New workflow\n      </button>\n    </div>\n  </div>\n  <div class=\"card-body\">\n    <table v-if=\"items.length > 0\" class=\"table table-borderless\">\n      <thead>\n        <tr>\n          <th>Name</th>\n          <th>Stages</th>\n          <th>Default</th>\n          <th>Created</th>\n          <th>Last Modified</th>\n          <th></th>\n        </tr>\n      </thead>\n      <tbody>\n        <tr v-for=\"workflow in items\" :key=\"workflow.id\">\n          <td>{{ workflow.title }}</td>\n          <td>{{ workflow.stages.length }}</td>\n          <td>\n            <i v-if=\"workflow.isDefault\" class=\"fas fa-check text-success\"></i>\n          </td>\n          <td>{{ formatDate(workflow.created) }}</td>\n          <td>{{ formatDate(workflow.lastModified) }}</td>\n          <td class=\"actions\">\n            <button v-on:click=\"editWorkflow(workflow)\" class=\"btn btn-sm btn-primary\">\n              <i class=\"fas fa-pen\"></i>\n            </button>\n            <button v-on:click=\"removeWorkflow(workflow)\" class=\"btn btn-sm btn-danger\">\n              <i class=\"fas fa-trash\"></i>\n            </button>\n          </td>\n        </tr>\n      </tbody>\n    </table>\n    <div v-else class=\"empty-info\">\n      <div class=\"card text-center\">\n        <div class=\"card-body\">\n          <h3>No workflows have been added yet</h3>\n          <p>Click on the button above to add a new workflow</p>\n        </div>\n      </div>\n    </div>\n  </div>\n\n  <div class=\"modal fade\" id=\"workflowModal\" tabindex=\"-1\" role=\"dialog\" aria-labelledby=\"workflowModalLabel\" aria-hidden=\"true\">\n    <div class=\"modal-dialog\" role=\"document\">\n      <div class=\"modal-content\">\n        <div class=\"modal-header\">\n          <h5 class=\"modal-title\" id=\"workflowModalLabel\">New Workflow</h5>\n          <button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-label=\"Close\">\n            <span aria-hidden=\"true\">&times;</span>\n          </button>\n        </div>\n        <div class=\"modal-body\">\n          <div class=\"form-group\">\n            <label for=\"workflow-title\">Name</label>\n            <input id=\"workflow-title\" v-model=\"newWorkflow.title\" class=\"form-control\" :class=\"{ 'is-invalid': !isTitleValid }\" @blur=\"validateTitle\" />\n            <div class=\"invalid-feedback\" v-if=\"!isTitleValid\">\n              {{ titleError }}\n            </div>\n          </div>\n          <div class=\"form-group\">\n            <label for=\"workflow-description\">Description</label>\n            <textarea id=\"workflow-description\" v-model=\"newWorkflow.description\" class=\"form-control\"></textarea>\n          </div>\n          <div class=\"form-group\">\n            <label>Workflow Type</label>\n            <div class=\"form-check\">\n              <input class=\"form-check-input\" type=\"radio\" name=\"workflowType\" id=\"workflow-type-blank\" value=\"blank\" v-model=\"workflowType\">\n              <label class=\"form-check-label\" for=\"workflow-type-blank\">\n                Blank Workflow\n              </label>\n            </div>\n            <div class=\"form-check\">\n              <input class=\"form-check-input\" type=\"radio\" name=\"workflowType\" id=\"workflow-type-standard\" value=\"standard\" v-model=\"workflowType\">\n              <label class=\"form-check-label\" for=\"workflow-type-standard\">\n                Standard Workflow (Draft \u2192 Review \u2192 Approved)\n              </label>\n            </div>\n          </div>\n        </div>\n        <div class=\"modal-footer\">\n          <button type=\"button\" class=\"btn btn-secondary\" data-dismiss=\"modal\">Cancel</button>\n          <button type=\"button\" class=\"btn btn-primary\" v-on:click=\"createWorkflow\" :disabled=\"!isTitleValid || !newWorkflow.title\">Create</button>\n        </div>\n      </div>\n    </div>\n  </div>\n\n  <div class=\"modal fade\" id=\"workflowDeleteModal\" tabindex=\"-1\" role=\"dialog\" aria-labelledby=\"workflowDeleteModalLabel\" aria-hidden=\"true\">\n    <div class=\"modal-dialog\" role=\"document\">\n      <div class=\"modal-content\">\n        <div class=\"modal-header\">\n          <h5 class=\"modal-title\" id=\"workflowDeleteModalLabel\">Delete Workflow</h5>\n          <button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-label=\"Close\">\n            <span aria-hidden=\"true\">&times;</span>\n          </button>\n        </div>\n        <div class=\"modal-body\">\n          Are you sure you want to delete the workflow \"{{ selectedWorkflow.title }}\"?\n        </div>\n        <div class=\"modal-footer\">\n          <button type=\"button\" class=\"btn btn-secondary\" data-dismiss=\"modal\">Cancel</button>\n          <button type=\"button\" class=\"btn btn-danger\" @click=\"confirmDeleteWorkflow\">Delete</button>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n"
});
Vue.component("workflow-edit", {
  data() {
    return {
      loading: false,
      workflow: null,
      isTitleValid: true,
      titleError: ''
    };
  },
  computed: {
    isNew() {
      return !this.workflow.id || this.workflow.id === '00000000-0000-0000-0000-000000000000';
    }
  },
  methods: {
    load() {
      this.loading = true;
      const id = window.location.pathname.split('/').pop();
      if (id && id !== 'add') {
        fetch(piranha.baseUrl + 'manager/api/workflow/' + id).then(response => response.json()).then(result => {
          this.workflow = result;
          this.loading = false;
        }).catch(error => {
          console.log("error:", error);
          this.loading = false;
        });
      } else {
        this.workflow = {
          id: '',
          title: '',
          description: '',
          isDefault: false,
          stages: []
        };
        this.loading = false;
      }
    },
    save() {
      if (!this.workflow.title) {
        this.isTitleValid = false;
        this.titleError = 'Name is required';
        return;
      }
      if (!this.isTitleValid) {
        return;
      }

      // Update sort order
      this.workflow.stages.forEach((stage, index) => {
        stage.sortOrder = index + 1;
      });
      fetch(piranha.baseUrl + 'manager/api/workflow/save', {
        method: 'POST',
        headers: piranha.utils.antiForgeryHeaders(),
        body: JSON.stringify(this.workflow)
      }).then(response => {
        if (!response.ok) {
          return response.json().then(error => {
            throw error;
          });
        }
        return response.json();
      }).then(result => {
        // Show notification
        piranha.notifications.push({
          body: 'The workflow was saved successfully',
          type: 'success'
        });

        // Go back to list
        window.location.href = piranha.baseUrl + 'manager/workflow';
      }).catch(error => {
        console.log("error:", error);
        piranha.notifications.push({
          body: error.body || 'An error occurred while saving the workflow',
          type: 'danger'
        });
      });
    },
    cancel() {
      window.location.href = piranha.baseUrl + 'manager/workflow';
    },
    addStage() {
      this.workflow.stages.push({
        id: '',
        workflowId: this.workflow.id,
        title: '',
        description: '',
        sortOrder: this.workflow.stages.length + 1,
        isPublished: false
      });
    },
    removeStage(index) {
      this.workflow.stages.splice(index, 1);
    },
    validateTitle() {
      if (!this.workflow.title) {
        this.isTitleValid = false;
        this.titleError = 'Name is required';
        return;
      }
      fetch(piranha.baseUrl + 'manager/api/workflow/title-unique?title=' + encodeURIComponent(this.workflow.title) + '&id=' + (this.workflow.id || '')).then(response => response.json()).then(result => {
        this.isTitleValid = result;
        if (!result) {
          this.titleError = 'Name already in use';
        }
      }).catch(error => console.log("error:", error));
    }
  },
  created() {
    this.load();
  },
  template: "\n<div v-if=\"workflow\">\n  <div class=\"card\">\n    <div class=\"card-header\">\n      <span class=\"title\">{{ isNew ? 'New Workflow' : workflow.title }}</span>\n    </div>\n    <div class=\"card-body\">\n      <div class=\"form-group\">\n        <label for=\"workflow-title\">Name</label>\n        <input id=\"workflow-title\" v-model=\"workflow.title\" class=\"form-control\" :class=\"{ 'is-invalid': !isTitleValid }\" @blur=\"validateTitle\" />\n        <div class=\"invalid-feedback\" v-if=\"!isTitleValid\">\n          {{ titleError }}\n        </div>\n      </div>\n      <div class=\"form-group\">\n        <label for=\"workflow-description\">Description</label>\n        <textarea id=\"workflow-description\" v-model=\"workflow.description\" class=\"form-control\"></textarea>\n      </div>\n      <div class=\"form-group\">\n        <div class=\"form-check\">\n          <input id=\"workflow-default\" v-model=\"workflow.isDefault\" type=\"checkbox\" class=\"form-check-input\">\n          <label for=\"workflow-default\" class=\"form-check-label\">Set as default workflow</label>\n        </div>\n      </div>\n    </div>\n  </div>\n\n  <div class=\"card mt-4\">\n    <div class=\"card-header\">\n      <span class=\"title\">Workflow Stages</span>\n    </div>\n    <div class=\"card-body\">\n      <div v-if=\"workflow.stages.length === 0\" class=\"alert alert-info\">\n        No stages have been added yet\n      </div>\n      <div v-else>\n        <div v-for=\"(stage, index) in workflow.stages\" :key=\"stage.id\" class=\"card mb-3\">\n          <div class=\"card-header\">\n            <span class=\"handle\">\n              <i class=\"fas fa-ellipsis-v\"></i>\n            </span>\n            <span class=\"title\">{{ stage.title || 'Untitled stage' }}</span>\n            <div class=\"btn-group float-right\">\n              <button v-on:click=\"removeStage(index)\" class=\"btn btn-sm btn-danger\">\n                <i class=\"fas fa-trash\"></i>\n              </button>\n            </div>\n          </div>\n          <div class=\"card-body\">\n            <div class=\"form-group\">\n              <label>Name</label>\n              <input v-model=\"stage.title\" class=\"form-control\" required />\n            </div>\n            <div class=\"form-group\">\n              <label>Description</label>\n              <textarea v-model=\"stage.description\" class=\"form-control\"></textarea>\n            </div>\n            <div class=\"form-group\">\n              <div class=\"form-check\">\n                <input v-model=\"stage.isPublished\" type=\"checkbox\" class=\"form-check-input\" :id=\"'stage-published-' + index\">\n                <label class=\"form-check-label\" :for=\"'stage-published-' + index\">Content is published in this stage</label>\n              </div>\n            </div>\n          </div>\n        </div>\n      </div>\n      <button v-on:click=\"addStage\" class=\"btn btn-primary\">\n        <i class=\"fas fa-plus\"></i> Add Stage\n      </button>\n    </div>\n  </div>\n\n  <div class=\"card mt-4\">\n    <div class=\"card-body\">\n      <button v-on:click=\"save\" class=\"btn btn-success\" :disabled=\"!isTitleValid || !workflow.title\">Save</button>\n      <button v-on:click=\"cancel\" class=\"btn btn-secondary ml-2\">Cancel</button>\n    </div>\n  </div>\n</div>\n"
});